import Card from "react-bootstrap/Card";
import './ReviewPane.css';
const ReviewPane = (reviewData) => {
    console.log(reviewData.reviewData);
    return (
        <div>
            <Card>
                <Card.Body>
                    <Card.Title className="reviewer">{reviewData.reviewData._source.reviewer}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">{reviewData.reviewData._source.contributions}</Card.Subtitle>
                </Card.Body>
                <Card.Body>
                    <div className="media-content">
                        <div className="review-title">{reviewData.reviewData._source.review_title} </div>
                        <p className="comment">{reviewData.reviewData._source.comment}</p>
                    </div>
                </Card.Body>
            </Card>
        </div>
    );
};
export default ReviewPane;
